import React from "react";
import classes from './Results.module.css';

const Results = (props) => {
    console.log('rendering results :>> ', props.results);
  return (
    <table>
      <thead>
        <tr>
          <th>id</th>
          <th>title</th>
          <th>vote</th>
        </tr>
      </thead>

      <tbody>
        {props.results.map((result) => (
          <tr className={classes.tr}>
            <td>{result.id}</td>
            <td>{result.title}</td>
            <td>{result.vote_average}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Results;
